import React, { useState } from "react";
import ProfileForm from "../components/ProfileForm"; // you can reuse the form from your previous code
import MatchesList from "../components/MatchesList"; // reuse your MatchesList

const MatchEnginePage = () => {
  const [internships, setInternships] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  const handleSubmit = (formData) => {
    setIsLoading(true);
    setTimeout(() => {
      const mockResults = [
        {
          title: "Machine Learning Intern",
          company: "Innovate AI",
          location: "Bengaluru",
          skills: ["Python", "TensorFlow", "scikit-learn", "ML"],
          match: 60,
        },
        {
          title: "Frontend Developer Intern",
          company: "WebWeavers",
          location: "Remote",
          skills: ["React", "JavaScript", "UI/UX"],
          match: 45,
        },
      ];
      setInternships(mockResults);
      setIsLoading(false);
    }, 1000);
  };

  return (
    <div className="flex flex-col md:flex-row p-4 sm:p-8 bg-gray-50 min-h-screen">
      <ProfileForm onSubmit={handleSubmit} />
      <MatchesList internships={internships} isLoading={isLoading} />
    </div>
  );
};

export default MatchEnginePage;
